package leetcode_test

import (
	"github.com/stretchr/testify/assert"
	"gocoder/leetcode"
	"testing"
)

func TestMinJump(t *testing.T) {
	arr := []int{1, 2, 3}
	can := leetcode.MinJump(arr)
	assert.Equal(t, 2, can)
}

func TestMinJump1(t *testing.T) {
	arr := []int{1}
	can := leetcode.MinJump(arr)
	assert.Equal(t, 0, can)
}

func TestMinJump2(t *testing.T) {
	arr := []int{1, 0}
	can := leetcode.MinJump(arr)
	assert.Equal(t, 1, can)
}

func TestMinJump3(t *testing.T) {
	arr := []int{3, 0, 0, 0}
	can := leetcode.MinJump(arr)
	assert.Equal(t, 1, can)
}

func TestMinJump4(t *testing.T) {
	arr := []int{3, 2, 1, 0, 4}
	can := leetcode.MinJump(arr)
	assert.Equal(t, 0, can)
}

func TestMinJump5(t *testing.T) {
	arr := []int{0}
	can := leetcode.MinJump(arr)
	assert.Equal(t, 0, can)
}

func TestMinJump6(t *testing.T) {
	arr := []int{2, 3, 1, 1, 4}
	can := leetcode.MinJump(arr)
	assert.Equal(t, 2, can)
}

